import { Link } from 'react-router-dom'
import Logo from '../Logo.png'

const divStyle = {
    opacity: 0.6
};
const textStyle = {
    fontWeight: 'bolder'

};
export default class Nave extends Component {
    render() {
        return (
            <div>

                <Navbar variant="dark">
                    <Nav>
                        <div>

                            <Button as={Link} to="/Home" variant="outline-light" className="ml-3"> Back</Button>
                        </div>
                    </Nav>
                </Navbar>

            </div>
        )
    }
}
